job_summary:
Minimum 3 years’ professional experience in vulnerability analysis;
GCWN (GIAC Certified Windows Security Administrator);
Minimum 4 years’ experience with:

Voorzien van informatie aan onze interne en externe auditors;
Wij zijn op zoek naar een Financial Accountant (1 FTE).
Kennis van SAP en S/4HANA is een pré.

Bij HLB Blömer kan het allemaal.
Je bent ambitieus, commercieel en ondernemend ingesteld;
Een laptop en alle faciliteiten die nodig zijn om thuis te kunnen…

Het verwelkomen en het in- en uitchecken van gasten;
Het verstrekken van vijf-sterren serivce;
Het oplossen van problemen en klachten;

Wat de dag van vandaag van ons vraagt.
Een controlestrategie te formuleren van complexere jaarrekeningposten;
Handelingsperspectief te geven door je bevindingen…

Bij voorkeur een kwalificatie tot lead auditor VCA en ISO 9001;
Bij voorkeur een diploma lead assessor;
Acquisitie naar aanleiding van onze vacatures wordt niet…

Fiscaal klankbord voor DGA’s en directies;
Openstaan voor nieuwe (tax) technologieën.
Advisering van cliënten rondom fiscale vraagstukken.
